import Error404Page from "../../pages/Error404Page"
import LogInPage from "../../pages/LogInPage"
import MyPosts from "../../pages/MyPosts"
import SignInPage from "../../pages/SignInPage"
import UserProfile from "../../pages/UserProfile"
import MyProfile from "../../pages/MyProfile"
import { DataRouterItemType, DataForLSType } from "../../types/Interfaces"
import AboutMePage from "../../pages/AboutMePage/AboutMePage"

const localStore: DataForLSType = JSON.parse(localStorage.getItem('DataFromLS') || '{}')
const isAuth = localStore.User.isAuth && localStore.User.isAuth !== undefined ? true : false

export const PublickDataPaths: DataRouterItemType[] = [
    {
        path: '/SignIn',
        element: <SignInPage />,
        id: 1
    },
    {
        path: '/LogIn',
        element: <LogInPage />,
        id: 2,
    },
    {
        path: '/MyPosts',
        element: <MyPosts />,
        id: 3
    },
    {
        path: '/Profile',
        element: <MyProfile />,
        id: 4,
    },
]

export const PrivateDataPaths: DataRouterItemType[] = [
    {
        path: '/SignIn',
        element: <SignInPage />,
        id: 1
    },
    {
        path: '/LogIn',
        element: <LogInPage />,
        id: 2,
    },
    {
        path: '/MyPosts',
        element: isAuth ? <SignInPage /> : <LogInPage />,
        id: 3
    },
]

export const AnywayDataPaths: DataRouterItemType[] = [
    {
        path: '*',
        element: <Error404Page />,
        id: 1
    },
    {
        path: 'Post/:id',
        element: <UserProfile />,
        id: 2,
    },
    {
        path: '/AboutProject',
        element: undefined,
        id: 3,
    },
    {
        path: '/AboutMe',
        element: <AboutMePage />,
        id: 4
    }
]
